/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	class="ui5-switch-root ${classMap(context.classes.main)}"	role="checkbox"	aria-checked="${ifDefined(context.checked)}"	aria-disabled="${ifDefined(context.ariaDisabled)}"	aria-labelledby="${ifDefined(context._id)}-hiddenText"	@click="${context._onclick}"	@keyup="${context._onkeyup}"	@keydown="${context._onkeydown}"	tabindex="${ifDefined(context.tabIndex)}"	dir="${ifDefined(context.rtl)}"><div class="ui5-switch-inner"><div class="ui5-switch-track" part="slider"><div class="ui5-switch-slider">				${ context.graphical ? block1(context) : block2(context) }<span class="ui5-switch-handle" part="handle"></span></div></div></div><input type='checkbox' ?checked="${context.checked}" class="ui5-switch-input" data-sap-no-tab-ref/><span id="${ifDefined(context._id)}-hiddenText" class="ui5-hidden-text">${ifDefined(context.hiddenText)}</span></div>`; };
const block1 = (context) => { return html`<span class="ui5-switch-text ui5-switch-text--on"><ui5-icon name="accept" dir="ltr" class="ui5-switch-icon-on"></ui5-icon></span><span class="ui5-switch-text ui5-switch-text--off"><ui5-icon name="decline" class="ui5-switch-icon-off"></ui5-icon></span>				`; };
const block2 = (context) => { return html`<span class="ui5-switch-text ui5-switch-text--on" part="text-on">${ifDefined(context._textOn)}</span><span class="ui5-switch-text ui5-switch-text--off" part="text-off">${ifDefined(context._textOff)}</span>				`; };

export default block0;
